import React,  { useEffect } from 'react'
import Gif from './Gif'

function ListOfGifs ({ gifs}) {

    useEffect(function () {
        //Una vez obtener los gifs actualizar el estado
        getGifs( {keyword: 'chile' }).then(gifs => setGifs(gifs))
      }, [])

    return gifs.map(({id, title, url}) =>
    <Gif 
        id={id}
        key={id}
        title={title}
        url={url}
    />
    )
}

export default ListOfGifs
